import React from "react";
import { Checkbox, FormControlLabel, FormLabel, makeStyles, Radio, TextField } from "@material-ui/core";
import { formDataType } from "../Homepage";
import { ErrorType } from "../Homepage";
import SearchIcon from "@mui/icons-material/Search";
import { MoreHoriz, Percent } from "@mui/icons-material";
import MyInputfield from "../MyInputfield";

type DemoFormProps = {
  data: formDataType;
  setData: React.Dispatch<React.SetStateAction<formDataType>>;
  errors: ErrorType;
  setErrors: React.Dispatch<React.SetStateAction<ErrorType>>;
};

const useStyles = makeStyles({
  form: {
    border: "1px solid black",
    margin: "10px",
  },
  formGroup: {
    display: "grid",
    gridTemplateColumns: "repeat(8, 1fr)",
    padding: "5px 0px",
    gap: "8px",
  },
  inputField: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "2/4",
  },
  inputFieldLeftLarge: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "2/5",
  },
  inputFieldRight: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "6/7",
  },
  inputFieldRightLarge: {
    border: "1px solid black",
    backgroundColor: "white",
    borderRadius: "50px",
    gridColumn: "6/8",
  },
  FormLeftLevel: {
    gridColumn: "1/2",
    padding: "0px 5px",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
    width: "100px",
  },
  FormTitleLevel: {
    gridColumn: "1/5",
    padding: "0px 5px",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  FormRightLevel: {
    gridColumn: "5/6",
    padding: "0px 0px",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
    width: "110px",
  },
  FormSelectButton1: {
    gridColumn: "6/7",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  FormSelectButton2: {
    gridColumn: "7/8",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  inputCheckbox1: {
    gridColumn: "1/3",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  inputCheckbox2: {
    gridColumn: "3/6",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  CallCenterLevel: {
    gridColumn: "2/4",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  RegDateLevel: {
    gridColumn: "5/9",
    color: "black",
    "&.MuiFormLabel-root": {
      fontSize: "12px",
    },
  },
  errorMessage: {
    Color: "red",
    padding: "10px",
  },
});

const CustomerSIAdd: React.FC<DemoFormProps> = (props) => {
  const classes = useStyles();

  // ============================== Methods =========================

  /** 
       This Method for get all change on the Input Field
      */
  const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = event.target;

    props.setData((prev) => {
      return {
        ...prev,
        [name]: value,
      };
    });

    props.setErrors((prev) => ({
      ...prev,
      [name]: "",
    }));
  };

  const formatYmd = (date:Date) => date.toISOString().slice(0, 10);

  return (
    <React.Fragment>
      <form className={classes.form}>
        <div className={classes.formGroup}>
          <FormLabel className={classes.FormTitleLevel}>
            Customer Supplementary Information
          </FormLabel>
          <FormLabel className={classes.FormRightLevel}>requester</FormLabel>
          <TextField
            id="requester"
            name="requester"
            className={classes.inputFieldRightLarge}
            InputProps={{ disableUnderline: true }}
            onChange={handleChange}
          />
          <SearchIcon />
          <FormLabel className={classes.FormLeftLevel}>region code</FormLabel>
          <TextField
            id="regionCode"
            name="regionCode"
            className={classes.inputFieldLeftLarge}
            InputProps={{ disableUnderline: true }}
            onChange={handleChange}
          />
          <FormLabel className={classes.FormRightLevel}>receipt</FormLabel>

          <FormControlLabel
            value="requirement"
            control={<Radio size="small" />}
            label="requirement"
